/* global describe, it, jsPDF, comparePdf */
/**
 * Standard spec tests
 */

describe("Module: WebPSupport", () => {
  beforeAll(loadGlobals);
  it("webp", () => {
    var webp =
      "data:image/webp;base64,";

    const doc = new jsPDF({
      orientation: "p",
      unit: "pt",
      format: "a4",
      floatPrecision: 2
    });
    doc.addImage(webp, "WEBP", 100, 200, 386, 395);

    comparePdf(doc.output(), "webp.pdf", "addimage");
  });

  it("multiple webp", () => {
    var webp =
      "data:image/webp;base64,";

    const doc = new jsPDF({
      orientation: "p",
      unit: "pt",
      format: "a4",
      floatPrecision: 2
    });
    doc.addImage(webp, "WEBP", 100, 25, 386, 395);
    doc.addImage(webp, "WEBP", 100, 425, 386, 395);

    comparePdf(doc.output(), "webp-multiple.pdf", "addimage");
  });
});
